import React from "react";
import Banner from "../Banner";
import "./index.css";

export default function Banners(props) {
  return (
    <div>
      <Banner
        titleSelection="Sélection Électronique"
        exclusivity="exclusivité web"
      />
      <Banner titleSelection="Sélection Homme" exclusivity="exclusivité web" />
      <Banner titleSelection="Sélection Femme" exclusivity="exclusivité web" />
      <Banner titleSelection="Sélection Enfant" exclusivity="exclusivité web" />
    </div>
  );
}
